import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Cards() {
  return (
    <div className='cards'>
      <div class="container">
                <div class="hmeexp-content wow fadeIn" data-wow-duration="1s" data-wow-delay="0.5s">
                   	<h1>Our Services</h1>
                    <h4>Choose from our wide range of household services</h4>

                <div class="tabs tabs-style-linemove">
                <nav>
						<ul>
							<li><a href="#section-linemove-1"><span>All<br/><em>Services</em></span></a></li>
							<li><a href="#section-linemove-2"><span>Clean<br/><em>My Home</em></span></a></li>
                            <li><a href="#section-linemove-3"><span>Guard<br/><em>My Home</em></span></a></li>

						</ul>
					</nav>

                </div>
                </div>
                </div>
    </div>
  );
}

export default Cards;
